import React from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import { AuthProvider, useAuth } from './contexts/AuthContext';
import Login from './components/Login';
import Register from './components/Register';
import RegisterDoctor from './components/RegisterDoctor';
import RoleSelection from './components/RoleSelection';
import PatientDashboard from './components/PatientDashboard';
import DoctorDashboard from './components/DoctorDashboard';
import AdminDashboard from './components/AdminDashboard';
import BookAppointment from './components/BookAppointment';
import './App.css';

const ProtectedRoute = ({ children, allowedRoles }) => {
  const { user, loading } = useAuth();

  if (loading) {
    return <div className="loading">Loading...</div>;
  }

  if (!user) {
    return <Navigate to="/login" />;
  }

  if (allowedRoles && !allowedRoles.includes(user.role)) {
    return <Navigate to="/unauthorized" />;
  }

  return children;
};

const AppRoutes = () => {
  const { user } = useAuth();

  return (
    <Routes>
      <Route path="/login" element={
        user ? <Navigate to={`/${user.role.toLowerCase()}/dashboard`} /> : <Login />
      } />
      <Route path="/register" element={
        user ? <Navigate to={`/${user.role.toLowerCase()}/dashboard`} /> : <RoleSelection />
      } />
      <Route path="/register/patient" element={
        user ? <Navigate to={`/${user.role.toLowerCase()}/dashboard`} /> : <Register />
      } />
      <Route path="/register/doctor" element={
        user ? <Navigate to={`/${user.role.toLowerCase()}/dashboard`} /> : <RegisterDoctor />
      } />

      {/* Patient Routes */}
      <Route path="/patient/dashboard" element={
        <ProtectedRoute allowedRoles={['PATIENT']}>
          <PatientDashboard />
        </ProtectedRoute>
      } />
      <Route path="/patient/book-appointment" element={
        <ProtectedRoute allowedRoles={['PATIENT']}>
          <BookAppointment />
        </ProtectedRoute>
      } />

      {/* Doctor Routes */}
      <Route path="/doctor/dashboard" element={
        <ProtectedRoute allowedRoles={['DOCTOR']}>
          <DoctorDashboard />
        </ProtectedRoute>
      } />

      {/* Admin Routes */}
      <Route path="/admin/dashboard" element={
        <ProtectedRoute allowedRoles={['ADMIN']}>
          <AdminDashboard />
        </ProtectedRoute>
      } />

      {/* Default Routes */}
      <Route path="/" element={
        user ? <Navigate to={`/${user.role.toLowerCase()}/dashboard`} /> : <Navigate to="/login" />
      } />

      <Route path="/unauthorized" element={
        <div className="unauthorized">
          <h1>Unauthorized Access</h1>
          <p>You don't have permission to access this page.</p>
        </div>
      } />

      <Route path="*" element={<Navigate to="/" />} />
    </Routes>
  );
};

function App() {
  return (
    <AuthProvider>
      <Router>
        <div className="App">
          <AppRoutes />
        </div>
      </Router>
    </AuthProvider>
  );
}

export default App;
